def find_primes_between_indices(int_list):
    def is_prime(n):
        if n <= 1:
            return False
        elif n <= 3:
            return True
        elif n % 2 == 0 or n % 3 == 0:
            return False
        i = 5
        while i*i <= n:
            if n % i == 0 or n % (i+2) == 0:
                return False
            i += 6
        return True

    prime_list = [i for i in int_list[37:96] if is_prime(i)]
    prime_list.sort(reverse=True)

    return prime_list
